--
-- Table structure for table `label_info`
--

DROP TABLE IF EXISTS `label_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `label_info` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `label_code` varchar(200) DEFAULT NULL COMMENT '标签名',
  `label_context` varchar(200) DEFAULT NULL COMMENT '说明',
  `label_type` varchar(256) DEFAULT NULL COMMENT '标签分类',
  `label_person` varchar(256) DEFAULT NULL COMMENT '联系人',
  `param_json` text COMMENT '标签可用参数',
  `owner` varchar(500) DEFAULT NULL COMMENT '账号',
  `is_delete` varchar(16) DEFAULT '0' COMMENT '是否删除,0:未删除,1:删除',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `label_expression` text COMMENT '运算表达式,仅支持sql',
  `label_engine` varchar(16) DEFAULT '' COMMENT '标签计算引擎,mysql,hive,spark,presto',
  `data_sources_choose_input` varchar(128) CHARACTER SET utf8mb4  NOT NULL DEFAULT '0' COMMENT '数据源id',
  `label_use_type` varchar(16) NOT NULL DEFAULT 'batch' COMMENT '使用方式,batch:值查人,single:人查值',
  `label_data_time_effect` varchar(16) NOT NULL DEFAULT 'day' COMMENT '数据时效性, day:天级,hour:小时级,second:准实时',
  `label_data_update_type` varchar(16) NOT NULL DEFAULT 'overwrite' COMMENT '数据更新类型,overwrite:覆盖,append:追加,get_append:值追加',
  `label_event_time_column` varchar(256) NOT NULL DEFAULT '' COMMENT '事件事件字段,默认为空',
  `label_data_code` varchar(256) NOT NULL DEFAULT '' COMMENT '数据标识,使用场景：从kafka来的数据根据此标识找到可以加工的标签都有哪些',
  `label_data_update_time` varchar(256) NOT NULL DEFAULT '' COMMENT '数据更新时间,调度根据此时间决定是否加工标签数据',
  `status` varchar(8) NOT NULL DEFAULT '2' COMMENT '1:发布,2:未发布',
  `label_default` varchar(1024) NOT NULL DEFAULT '' COMMENT '标签默认值,json格式',
  `product_code` varchar(64) NOT NULL DEFAULT '' COMMENT '产品code',
  PRIMARY KEY (`id`),
  KEY `idx_label_code` (`label_code`)
) ENGINE=InnoDB AUTO_INCREMENT=1175194744460939265 DEFAULT CHARSET=utf8mb4 ;
/*!40101 SET character_set_client = @saved_cs_client */;

