  `notice_finish` varchar(8) NOT NULL DEFAULT 'off' COMMENT '启用邮箱告警 on:启用,off:禁用',
  `notice_timeout` varchar(8) NOT NULL DEFAULT 'off' COMMENT '启用邮箱告警 on:启用,off:禁用',
  `schedule_id` varchar(256) NOT NULL DEFAULT '' COMMENT '调度器标识',
  PRIMARY KEY (`id`),
  KEY `idx_group_id` (`group_id`),
  KEY `idx_status` (`status`),
  KEY `idx_notice` (`is_notice`),
  KEY `idx_job_id_owner` (`group_id`,`owner`)
) ENGINE=InnoDB AUTO_INCREMENT=1168160014909575169 DEFAULT CHARSET=utf8mb4 ;
